list = [4, 2, 3, 7, 1]
'''
    In Bubble Sort, we compare the element with adjacent element
'''
def bubbleSort(list) :
    for i in range(len(list)-1) :
        for j in range(0, len(list)-1-i) :
            if list[j] > list[j+1] :
                temp = list[j]
                list[j] = list[j+1]
                list[j+1] = temp

    return list

'''
    In Selection Sort, we select the smallest number and swap it with the first position
'''
def selectionSort(list) :
    for i in range(len(list)-1) :
        indexSmall = i
        for j in range(i+1, len(list)) :
            if list[indexSmall] > list[j] :
                indexSmall = j
        
        temp = list[i]
        list[i] = list[indexSmall]
        list[indexSmall] = temp
    return list

'''
    In Insertion Sort, we select each element and insert/swap it in correct position and
    shift all the other element
'''
def insertionSort(list) :
    for i in range(len(list)-1) :
        if list[i] > list[i+1] :
            j = i+1
            while (j > 0 and list[j-1] > list[j]) :
                temp = list[j-1]
                list[j-1] = list[j]
                list[j] = temp
                j=j-1

    return list



